import { Component } from '@angular/core';
import { HeroComponent } from '@app/shared/components/hero/hero.component';

@Component({
  selector: 'app-home',
  standalone: true,
  imports: [HeroComponent, MatGridListModule, MatCardModule],
  templateUrl: './home.component.html',
  styleUrl: './home.component.scss',
})
export class HomeComponent {
  services = [
    { name: 'Service 1', description: 'Description of Service 1' },
    { name: 'Service 2', description: 'Description of Service 2' },
    // ... add 7 more services to complete the 3x3 grid
  ];
}
